interface IDetail {
  name: string;
  link: string;
  image_url: string;
}

async function fetchData() {
  let page = 1;
  let isValidRequest = true;
  const details: IDetail[] = [];
  while (isValidRequest) {
    try {
      const response = await fetch(
        "https://api-r3.tagalys.com/v1/mpages/_platform/271553691782",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            request: ["total", "details"],
            page: page,
            per_page: 100,
            product_listing_page_id: 262012141702,
            identification: {
              client_code: "FAA9741EF5AE9305",
              api_key: "806bd0e6ebcd0bbbdca9e7eb6e6136e8",
              store_id: 2315124788,
              currency: "AUD",
              api_client: {
                vendor: "tagalys-ui-widgets",
                language: "js",
                version: "2.0.0-beta1",
              },
            },
          }),
        }
      );

      if (!response.ok) {
        isValidRequest = false;
        console.log(page);
        console.log(JSON.stringify(details));
        console.error("Invalid request:", response.statusText);
        break;
      }

      const data = await response.json();

      if (data.details.length !== 0) {
        data.details.forEach((detail: IDetail) => {
          console.log(detail.name);
          details.push({
            name: detail.name,
            link: detail.link,
            image_url: detail.image_url,
          });
        });
      }

      // Increment the page number for the next request
      page++;
    } catch (error) {
      console.error("Error:", error);
      isValidRequest = false;
    }
  }

  return details;
}

